import React from 'react'

const ShowHighestVolume = (volume) => {
    return (
        <div>
            <h1 style={{ color: 'steelblue', backgroundColor:'black'  }}>Highest volume {volume[0]}</h1>

        </div>
    )
}

export default ShowHighestVolume
